# input_string = '2022-06-19T00:00:00+00:00'
# date = dt.datetime.fromisoformat(input_string1)
# print(date.strftime('%d.%m.%Y'))
# print(date.strftime('%H'))


dt_str = "2023-08-03T21:00:00Z"  # Input ISO-8601 date and time string
dt = datetime.fromisoformat(dt_str)  # Parse the ISO-8601 string into a datetime object
gmt_plus_3 = pytz.timezone('Europe/Kyiv')  # Define the GMT+3 timezone
dt_gmt_plus_3 = dt.replace(tzinfo=pytz.utc).astimezone(gmt_plus_3) # Convert the datetime to the GMT+3 timezone
date_gmt_plus_3 = dt_gmt_plus_3.strftime("%Y-%m-%d")
start_time_gmt_plus_3 = dt_gmt_plus_3.strftime("%H:%M")
end_time_gmt_plus_3 = (dt_gmt_plus_3 + timedelta(hours=1)).strftime("%H:%M")
# Print the result
print(dt_gmt_plus_3)
# Separate date (YYYY-mm-dd) and time (hour without seconds)


# t_day = str((tod - timedelta(days=delta)).strftime('%d'))



# Print the results
print("Date (GMT+3):", date_gmt_plus_3)
print("Start Time (GMT+3):", start_time_gmt_plus_3)
print("End Time (GMT+3):", end_time_gmt_plus_3)

